css:
.sheet-toolbar {
  border-bottom: 1px solid #2c2c2c;
  box-shadow: none;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  filter: invert(100%);
}
img.content-dark {
  filter: invert(100%);
}
img.content-light {
  filter: invert(100%);
}
.mail-label {
  filter: contrast(110%) brightness(85%);
}
#message-list .message-item-wrap .message-item-white-wrap {
  box-shadow: 0 0 0.5px rgba(255, 255, 255, 0.28), 0 1px 1.5px rgba(255, 255, 255, 0.08);
}
.thread-list .list-item:not(.unread):not(.selected):not(.focused) {
  color: #aaa;
}
.item-count-box {
  min-width: 15px;
  height: 15px;
  text-align: center;
  display: inline;
  font-size: 10.5px;
  padding: 0 0.286em 0 0.286em;
  line-height: 15px;
  border-radius: 2px;
  align-self: center;
}
body.platform-win32 .item-count-box {
  border-radius: 0;
}
.windows-btn-bg {
  transition: background 300ms, box-shadow 300ms;
  background: transparent;
  border-radius: 0;
}
.windows-btn-bg:hover {
  background: rgba(44, 44, 44, 0.8);
}
.windows-btn-border {
  border: 0;
  box-shadow: 0 0 0 2px rgba(44, 44, 44, 0.8);
}
.main-calendar {
  height: 100%;
}
.fixed-popover .calendar-event-popover {
  color: rgba(238, 238, 238, 0.8);
  background-color: #212121;
  display: flex;
  flex-direction: column;
  font-size: 13.02px;
  max-height: 95vh;
  width: 300px;
}
.fixed-popover .calendar-event-popover .location {
  color: rgba(238, 238, 238, 0.6);
  padding: 5px 12px;
  word-wrap: break-word;
  flex-shrink: 0;
}
.fixed-popover .calendar-event-popover .title-wrapper {
  color: white;
  display: flex;
  font-size: 18.06px;
  background-color: #58b660;
  border-top-left-radius: 3px;
  border-top-right-radius: 3px;
  padding: 5px 12px;
  align-items: center;
  flex-shrink: 0;
}
.fixed-popover .calendar-event-popover .title-wrapper .title {
  padding-right: 5px;
}
.fixed-popover .calendar-event-popover .edit-icon {
  background-color: white;
  cursor: pointer;
}
.fixed-popover .calendar-event-popover .invitees .scroll-region-content {
  max-height: 160px;
  word-wrap: break-word;
  position: relative;
}
.fixed-popover .calendar-event-popover .description {
  white-space: pre-line;
  word-wrap: break-word;
}
.fixed-popover .calendar-event-popover .description .scroll-region-content {
  max-height: 250px;
  position: relative;
}
.fixed-popover .calendar-event-popover .label {
  color: rgba(238, 238, 238, 0.6);
}
.fixed-popover .calendar-event-popover .section {
  border-top: 1px solid #2c2c2c;
  padding: 5px 12px;
}
.fixed-popover .calendar-event-popover .row.time .time-picker {
  text-align: center;
}
.fixed-popover .calendar-event-popover .row.time .time-picker-wrap {
  margin-right: 5px;
}
.fixed-popover .calendar-event-popover .row.time .time-picker-wrap .time-options {
  z-index: 10;
}
.quick-event-popover {
  width: 250px;
}
.preview-notice {
  display: block;
  box-sizing: border-box;
  -webkit-print-color-adjust: exact;
  padding: 8px 12px;
  border-bottom: 1px solid #ebe0cc;
  color: #a98842;
  background-color: #f2ebde;
  white-space: nowrap;
  overflow: hidden;
}
